/string></var><var name=\'LASTUPDATEDBY\'><string>farcry_CLIENTUD</string></var><var name=\'CREATEDBY\'><string>farcry_CLIENTUD</string></var><var name=\'DATETIMECREATED\'><dateTime>2015-12-1T6:43:12+0:0</dateTime></var><var name=\'CATHTML\'><string></string></var><var name=\'LOCKED\'><number>0.0</number></var><var name=\'STATUS\'><string>approved</string></var><var name=\'METAKEYWORDS\'><string></string></var><var name=\'aRelatedIDs\'><array length=\'0\'></array></var><var name=\'SEOTITLE\'><string></string></var><var name=\'TEASER\'><string>Về chúng tôi</string></var><var name=\'DISPLAYMETHOD\'><string>displayPageFull</string></var><var name=\'aObjectIDs\'><array length=\'0\'></array></var><var name=\'EXTENDEDMETADATA\'><string></string></var><var name=\'OBJECTID\'><string>CB6DAE20-97F6-11E5-A552382C4A0C3870</string></var><var name=\'LABEL\'><string>About us</string></var><var name=\'VERSIONID\'><string></string></var><var name=\'TITLE\'><string>About us</string></var><var name=\'TEASERIMAGE\'><string></string></var><var name=\'OWNEDBY\'><string>CDD3B33E-A463-9B75-DC0150D316830765</string></var><var name=\'BODY\'><string>&lt;p&gt;Nhịp sống hiện đại ngày càng ảnh hưởng đến lối sống của mọi tầng lớp xã hội. Trong đó, giới trẻ là những người chịu ảnh hưởng nhiều nhất của lối sống mới này. Trong một cuộc điều tra nhỏ về nhu cầu mua sắm và chăm chút cho vẻ bề ngoài xinh đẹp của giới nữ thì có tới 99% cho kết quả thuận. Bởi vì đời sống ngày càng phát triền, những bộ trang phục và theo đó những phụ kiệm đi kèm, có thể nói lên phong cách và cá tính rất riêng của họ. Chúng tôi hiểu và đã cho ra đời website &lt;a href=&quot;https://duthu.vn/&quot;&gt;https://duthu.vn&lt;/a&gt; nhằm đáp ứng nhu cầu đấy, nhưng theo một cách khác, mới hơn và hoàn hảo hơn.&lt;/p&gt;\n&lt;p&gt;      Hiện nay, xu hướng thương mại điện tử đang phát triển rất mạnh, trong tương lai sẽ là mô hình chủ đạo và tất yếu   &lt;a href=&quot;https://duthu.vn/&quot;&gt;https://duthu.vn&lt;/a&gt; đã tạo nên sự khác biệt bởi chính hình thức này: Một mô hình cửa hàng trực tuyến, cung cấp mọi góc độ của sản phẩm nhằm giúp khách hàng dễ dàng chọn lựa sản phẩm yêu thích, liên tục cập nhật mẫu mã đa dạng và kèm theo đó là phong cách bán hàng chuyên nghiệp, chu đáo giúp cho bạn trẻ, những người bận rộn, những người làm việc văn phòng không có thời gian đi shopping vẫn có thể thỏa sức mua sắm. với mô hình này chúng tôi đã và đang làm hài lòng tất cả các Khách hàng.&lt;/p&gt;\n&lt;p&gt;      Hệ thống bán hàng của chúng tôi xuất hiện ở mọi nơi trên Internet từ Facebook.  Bạn có thể tìm hiểu kỹ hơn để yên tâm hơn về những sản phẩm cũng như dịch vụ bán hàng trực tuyến của chúng tôi theo những đường dẫn sau đây:&lt;/p&gt;\n&lt;p&gt;                + Facebook: &lt;a href=&quot;https://www.facebook.com/donghoteenhot&quot;&gt;https://www.facebook.com/donghoteenhot&lt;/a&gt;&lt;/p&gt;\n&lt;p&gt;                + Website: &lt;a href=&quot;http://duthu.vn/&quot;&gt;duthu.vn&lt;/a&gt;&lt;/p&gt;\n&lt;p&gt;      Bạn hoàn toàn có thể yên tâm đặt hàng rồi nhé!&lt;/p&gt;\n&lt;p&gt;Trân trọng!&lt;/p&gt;</string></var></struct></data></wddxPacket>','About us',NULL,'127.0.0.1','farcry_CLIENTUD'),('<wddxPacket version=\'1.0\'><header/><data><struct><var name=\'TMPCATEGORIES\'><string></string></var><var name=\'FRIENDLYURLS\'><recordset rowCount=\'2\' fieldNames=\'datetimelastupdated,lockedBy,fuStatus,lastupdatedby,applicationName,createdby,refobjectid,friendlyURL,datetimecreated,locked,bDefault,ObjectID,redirectionType,redirectTo,label,ownedby,queryString,typename\' type=\'coldfusion.sql.QueryTable\'><field name=\'datetimelastupdated\'><dateTime>2015-12-1T9:20:50+0:0</dateTime><dateTime>2015-12-1T9:20:50+0:0</dateTime></field><field name=\'lockedBy\'><string></string><string></string></field><field name=\'fuStatus\'><number>1.0</number><number>0.0</number></field><field name=\'lastupdatedby\'><string>farcry_CLIENTUD</string><string>farcry_CLIENTUD</string></field><field name=\'applicationName\'><str