mber>1.0</number></var><var name=\'TEASER\'><string>Gần đây, dầu dừa ngày càng được sử dụng thịnh hành trên thế giới. Dầu dừa làm cân bằng lượng đường trong máu, kháng khuẩn, chống viêm, hỗ trợ hấp thụ vitamin và khoáng chất, v,v.....Có thể thấy, tác dụng mà dầu dừa mang lại là rất lớn.</string></var><var name=\'aAttachments\'><array length=\'0\'></array></var><var name=\'OBJECTID\'><string>984FA2A0-C64F-11E5-8666382C4A0C3870</string></var><var name=\'IMGFULL\'><string>/images/hsBlog/imgFull/50_of_the_best_uses_for_coconut_oil_image-b6bfe.jpg</string></var><var name=\'SOURCEIMAGE\'><string>/images/hsBlog/imgSource/50_of_the_best_uses_for_coconut_oil_image-b6bfe.jpg</string></var><var name=\'aRelated\'><array length=\'0\'></array></var><var name=\'LABEL\'><string>50 CÔNG DỤNG TUYỆT VỜI CỦA DẦU DỪA</string></var><var name=\'TITLE\'><string>50 CÔNG DỤNG TUYỆT VỜI CỦA DẦU DỪA</string></var><var name=\'OWNEDBY\'><string>CDD3B33E-A463-9B75-DC0150D316830765</string></var><var name=\'BODY\'><string>&lt;p&gt;Gần đây, &lt;a href=&quot;http://duthu.vn/&quot; target=&quot;_blank&quot;&gt;dầu dừa&lt;/a&gt; ngày càng được sử dụng thịnh hành trên thế giới. Dầu dừa làm cân bằng lượng đường trong máu, kháng khuẩn, chống viêm, hỗ trợ hấp thụ vitamin và khoáng chất, v,v.....Có thể thấy, tác dụng mà dầu dừa mang lại là rất lớn.&lt;/p&gt;\r\n&lt;p&gt;Dưới đây là 50 cách sử dụng dầu dừa mang lại hiệu quả cao trong việc  &lt;a href=&quot;http://duthu.vn/&quot; target=&quot;_blank&quot;&gt;bảo vệ sức khỏe&lt;/a&gt; và &lt;a href=&quot;http://duthu.vn/&quot; target=&quot;_blank&quot;&gt;sắc đẹp&lt;/a&gt;.&lt;/p&gt;\r\n&lt;p&gt;&lt;img src=&quot;http://skds3.vcmedia.vn/2014/50_of_the_best_uses_for_coconut_oil_image-b6bfe.jpg&quot; border=&quot;0&quot; alt=&quot;50 công dụng tuyệt vời của dầu dừa&quot; /&gt;&lt;/p&gt;\r\n&lt;p&gt;1. Mát xa&lt;/p&gt;\r\n&lt;p&gt;Dầu dừa giúp bạn làm dịu đi sự mệt mỏi và giảm đau cho các cơ bắp. Khi sử dụng, bạn nên thêm vài giọt tinh dầu để tăng hiểu quả.&lt;/p&gt;\r\n&lt;p&gt;2. Bệnh nấm chân&lt;/p&gt;\r\n&lt;p&gt;Các đặc tính kháng nấm mạnh mẽ của dầu dừa sẽ giúp bạn ngăn chặn những căn bệnh về nấm. Thêm vài giọt thảo mộc oregano hoặc tinh dầu trà giúp tăng khả năng chống nấm&lt;/p&gt;\r\n&lt;p&gt;3. Mụn trứng cá&lt;/p&gt;\r\n&lt;p&gt;Trong dầu dừa chứa các axit béo chuỗi trung bình như axi lauric, axit capric,.. có tác dụng kháng khuẩn gây mụn trứng cá. Thoa trực tiếp dầu dừa lên vùng da bị mụn ,để khoảng 15 đến 20 phút sau đó rửa lại bằng sửa rửa mặt&lt;/p&gt;\r\n&lt;p&gt;&lt;img src=&quot;http://skds3.vcmedia.vn/2014/50_of_the_best_uses_for_coconut_oil_massage_oil_pic-31a79.jpg&quot; border=&quot;0&quot; alt=&quot;Tinh dầu dừa được sử dụng rộng rãi trong mát xa và spa&quot; /&gt;&lt;/p&gt;\r\n&lt;p&gt;&lt;em&gt;Tinh dầu dừa được sử dụng rộng rãi trong mát xa và spa&lt;/em&gt;&lt;/p&gt;\r\n&lt;p&gt;4. Chất tẩy rửa&lt;/p&gt;\r\n&lt;p&gt;Dầu dừa sẽ giúp bạn loại bỏ những vết bụi bẩn nhanh chóng và hiệu quả.&lt;/p&gt;\r\n&lt;p&gt;5. Trị chấy rận&lt;/p&gt;\r\n&lt;p&gt;Dầu dừa sẽ giúp bạn loại bỏ vấn đề khó chịu này&lt;/p&gt;\r\n&lt;p&gt;6. Rạn da&lt;/p&gt;\r\n&lt;p&gt;Phụ nữ mang thai dùng dầu dừa sẽ giúp làm giảm và ngăn các vết rạn da. Dầu dừa sẽ giúp làn da của bạn trở nên mềm mại.&lt;/p&gt;\r\n&lt;p&gt;7. Mụn cơm và Nốt ruồi&lt;/p&gt;\r\n&lt;p&gt;Bôi dầu dừa vào khu vực da có mụn cơm hoặc nốt ruồi, sau đó băng lại. Thay băng và bôi dầu dừa mỗi ngày.&lt;/p&gt;\r\n&lt;p&gt;8. Kem dưỡng ẩm&lt;/p&gt;\r\n&lt;p&gt;Sử dụng dầu dừa là cách tuyệt vời để giữ ẩm cho làn da, đặc biệt với da khô hoặc da bị hư tổn&lt;/p&gt;\r\n&lt;p&gt;9. Tẩy da chết trên mặt&lt;/p&gt;\r\n&lt;p&gt;Trộn dầu dừa với thuốc muối (baking soda), đường hoặc quế, và bột yến mạch. Sau đó bôi hỗn hợp lên mặt và mát xa nhẹ nhàng&lt;/p&gt;\r\n&lt;p&gt;10. Trị gàu&lt;/p&gt;\r\n&lt;p&gt;Mát xa da đầu với dầu dừa để giảm bớt các triệu chứng của gàu như ngứa, hay bong chóc da đầu&lt;/p&gt;\r\n&lt;p&gt;&lt;img src=&quot;http://skds3.vcmedia.vn/2014/coconut-f6133.jpg&quot; border=&quot;0&quot; alt=&quot;50 công dụng tuyệt vời của dầu dừa&quot; /&gt;&lt;/p&gt;\r\n&lt;p&gt;11. Giảm cơn thèm ăn&lt;/p&gt;\r\n&lt;p&gt;Dùng 1 thìa dầu dừa trước khi ăn sẽ giúp bạn kiếm chế cơn thèm ăn&lt;/p&gt;\r\n&lt;p&gt;12. Xóa mờ nếp nhăn&lt;/p&gt;\r\n&lt;p&gt;Mát xa dầu dừa vào các nếp nhăn sẽ khiến chúng mờ dẫn và biến mất&lt;/p&gt;\r\n&lt;p&gt;13. Đau họng&lt;/p&gt;\r\n&lt;p&gt;Ngậm 1 thìa dầu dừa sẽ giúp giảm đau và sưng họng, ngăn ngừa nhiễm trùng.&lt;/p&gt;\r\n&lt;p&gt;14. Bệnh vảy nến&lt;/p&gt;\r\n&lt;p&gt;Xoa dầu dừa lên vùng da bị tổn thương để diệt nấm. Thêm tinh dầu tra để giảm nhiễm trùng hiệu quả hơn&lt;/p&gt;\r\n&lt;p&gt;15. Bệnh mụn rộp môi do vi rút herpes&lt;/p&gt;\r\n&lt;p&gt;Dầu dừa có đặc tính kháng khuẩn , giúp cơ thể tránh khỏi các loại vi khuẩn gây rộp môi. Thoa dầu dừa lên vùng miệng bị rộp, thêm giọt tinh dầu thơm oregano. &lt;/p&gt;\r\n&lt;p&gt;16. Son dưỡng ẩm&lt;/p&gt;\r\n&lt;p&gt;Dầu dừa cung cấp một số chất bảo vệ khỏi ảnh nắng mặt trời, khoảng SPF4&lt;/p&gt;\r\n&lt;p&gt;17. Chất bôi trơn&lt;/p&gt;\r\n&lt;p&gt;Dầu dừa là một chất bôi trơn tự nhiên, không hóa chất&lt;/p&gt;\r\n&lt;p&gt;18. Loại bỏ bã kẹo cao su&lt;/p&gt;\r\n&lt;p&gt;Dầu dừa sẽ giúp bạn lấy bã kẹo cao su khỏi tóc hay quần áo dễ dàng hơn&lt;/p&gt;\r\n&lt;p&gt;19. Tăng cường sức khỏe cho vật nuôi&lt;/p&gt;\r\n&lt;p&gt;Bộ lông của vật nuôi sẽ trở nên bóng mượt hơn với dầu dừa, diệt sạch bọ chét&lt;/p&gt;\r\n&lt;p&gt;&lt;img src=&quot;http://skds3.vcmedia.vn/2014/benefits_of_coconut_oil_for_pets_pic-d1259.jpg&quot; border=&quot;0&quot; alt=&quot;50 công dụng tuyệt vời của dầu dừa&quot; /&gt;&lt;/p&gt;\r\n&lt;p&gt;20. Lẹo mắt/ Đau mắt đỏ&lt;/p&gt;\r\n&lt;p&gt;Xoa một ít dầu dừa vào chỗ lên lẹo hoặc xung quanh mặt để tránh các bệnh nhiễm trùng mắt và giảm khó chịu một cách nhanh chóng.&lt;/p&gt;\r\n&lt;p&gt;21. Đau tai&lt;/p&gt;\r\n&lt;p&gt;Đau tai, viêm tai hoặc nhiễm trùng tai có thể sẽ khỏi rất nhanh chỉ với một vài giọt dầu dừa trộn với dầu tỏi.&lt;/p&gt;\r\n&lt;p&gt;22. Viêm da tiết bã ở trẻ sơ sinh&lt;/p&gt;\r\n&lt;p&gt;Dầu dừa rất an toàn cho trẻ sơ sinh, giúp giảm ngứa, đau hay bong da ở trẻ sơ sinh&lt;/p&gt;\r\n&lt;p&gt;23. Vết hăm tã&lt;/p&gt;\r\n&lt;p&gt;Bôi dầu dừa lên vết hăm tã ở trẻ sẽ làm giảm các vết hăm rất hiệu quả&lt;/p&gt;\r\n&lt;p&gt;24. Vết bầm tím&lt;/p&gt;\r\n&lt;p&gt;Chà dầu dừa lên vùng da bị thâm tím để làm tan vết máu bầm&lt;/p&gt;\r\n&lt;p&gt;25. Đồi mồi ở người cao tuổi&lt;/p&gt;\r\n&lt;p&gt;Dầu dừa có tác dụng trên bất kỳ làn da có tỳ vết. Nó làm mờ đi các chấm đồi mồi và có tác dụng chống oxy hóa mạnh mẽ.&lt;/p&gt;\r\n&lt;p&gt;26. Kem cạo râu&lt;/p&gt;\r\n&lt;p&gt;Dùng dầu dừa khi cạo râu sẽ giúp bạn có làn da mịn màng và mềm mại.&lt;/p&gt;\r\n&lt;p&gt;27. Vết xước sau khi cạo râu&lt;/p&gt;\r\n&lt;p&gt;Sau mỗi lần cạo râu, bạn thấy da mặt hơi căng, khô, thậm chị có những vết xước. Dầu dừa sẽ giúp da bạn mềm hơn, và chữa lành các vết xước.&lt;/p&gt;\r\n&lt;p&gt;28. Kem đánh răng&lt;/p&gt;\r\n&lt;p&gt;Trộn một phần dầu dừa với một phần nước soda (viên sủi NaHCO3) và thêm vài giọt tinh dầu bạc hà. Hỗn hợp tạo ra kem đánh răng tự nhiên làm sạch và trắng răng mà không hề có chất bảo quản.&lt;/p&gt;\r\n&lt;p&gt;29. Bệnh thủy đậu&lt;/p&gt;\r\n&lt;p&gt;Dầu dừa làm giảm ngứa ở bệnh thủy đậu cũng nhưng các vết do muỗi hay côn trùng cắn.&lt;/p&gt;\r\n&lt;p&gt;30. Viêm nhiễm do nấm&lt;/p&gt;\r\n&lt;p&gt;Dầu dừa sẽ ngăn ngừa các bệnh nhiễm trùng do nấm cả bên trong lẫn bên ngoài cơ thể.&lt;/p&gt;\r\n&lt;p&gt;31. Tẩy trang&lt;/p&gt;\r\n&lt;p&gt;Xoa dầu dừa lên mặt sẽ giúp bạn dễ dàng loại bỏ lớp trang điểm. Giúp da bạn sáng và sạch hơn.&lt;/p&gt;\r\n&lt;p&gt;&lt;img src=&quot;http://skds3.vcmedia.vn/2014/coconut_oil_natural_hair_conditioner_image-5b5c4.jpg&quot; border=&quot;0&quot; alt=&quot;50 công dụng tuyệt vời của dầu dừa&quot; /&gt;&lt;/p&gt;\r\n&lt;p&gt;32. Dưỡng tóc&lt;/p&gt;\r\n&lt;p&gt;Dầu dừa sẽ giúp tóc bạn chắc khỏe và chăm sóc tóc bị hư tổn . Mát xa dầu dừa lên da đầu, sau 10 phút gội lại bằng nước sạch.&lt;/p&gt;\r\n&lt;p&gt;33. Đánh bóng đồ gỗ&lt;/p&gt;\r\n&lt;p&gt;Dầu dừa cũng được sử dụng sơn bóng một số loại đồ gỗ. Nó cũng cấp một lớp bảo vệ chống bụi bẩn.&lt;/p&gt;\r\n&lt;p&gt;34. Cung cấp nguồn năng lượng&lt;/p&gt;\r\n&lt;p&gt;Chất béo đặc biệt có trong dầu dừa là nguồn năng lượng tuyệt vời để cải thiện sức khỏe, tăng khả năng miễn dịch cho cơ thể.&lt;/p&gt;\r\n&lt;p&gt;35. Khử mùi&lt;/p&gt;\r\n&lt;p&gt;Trộn dầu dừa với bột bắp, thuốc muối, hoặc bất kỳ tinh dầu dừa mà bạn ưa thích, sẽ tạo ra chất khử mùi tự nhiên, không độc hại.&lt;/p&gt;\r\n&lt;p&gt;36. Xóa tan quầng thâm mắt&lt;/p&gt;\r\n&lt;p&gt;.Trước khi đi ngủ, thoa dầu dừa lên vùng mắt bị thâm hoặc sưng , để qua đêm , sáng dậy rửa bằng nước sạch . Trong dầu dừa chứa nhiều chất chống oxy hóa, vitamin làm tăng độ đàn hồi cho da.&lt;/p&gt;\r\n&lt;p&gt;37. Bệnh Eczema&lt;/p&gt;\r\n&lt;p&gt;Dầu dừa làm giảm ngứa, bong da, hay khô da do bệnh eczema, vẩy nến hay viêm da gây nên.&lt;/p&gt;\r\n&lt;p&gt;38. Cháy nắng&lt;/p&gt;\r\n&lt;p&gt;Bôi dầu dừa lên cơ thể sẽ giúp bạn ngăn ngừa cháy nắng hay giảm cảm giác bỏng rát khi da bạn bị cháy nắng.&lt;/p&gt;\r\n&lt;p&gt;39. Bệnh trĩ&lt;/p&gt;\r\n&lt;p&gt;Dầu dừa sẽ làm giảm đau và khó chịu mà bệnh trĩ gây nên.&lt;/p&gt;\r\n&lt;p&gt;40. Chảy máu cam&lt;/p&gt;\r\n&lt;p&gt;Nếu bạn thường xuyên chảy máu cam, xoa một ít dầu dừa vào trong lỗ mũi.&lt;/p&gt;\r\n&lt;p&gt;41. Nhiệt miệng&lt;/p&gt;\r\n&lt;p&gt;Thoa dầu dừa lên vết loét miệng để làm giảm đau và ngăn nhiễm trùng.&lt;/p&gt;\r\n&lt;p&gt;&lt;img src=&quot;http://skds3.vcmedia.vn/2014/coconut_oil_strengthens_teeth_image-62ef0.jpg&quot; border=&quot;0&quot; alt=&quot;50 công dụng tuyệt vời của dầu dừa&quot; /&gt;&lt;/p&gt;\r\n&lt;p&gt;42. Bệnh trào ngược dạ dày&lt;/p&gt;\r\n&lt;p&gt;Ăn một thìa dầu dừa trong bữa ăn để tránh ợ chua và ợ nóng.&lt;/p&gt;\r\n&lt;p&gt;43. Đau răng&lt;/p&gt;\r\n&lt;p&gt;Dầu dừa giúp bạn giảm đau nhức và tăng cường chắc khỏe cho hàm răng. Trộn giọt dầu dừa với 1 giọt dầu đinh hương sẽ giúp bạn giảm đau ngày lập tức&lt;/p&gt;\r\n&lt;p&gt;44. Nhiễm trùng đường tiết niệu&lt;/p&gt;\r\n&lt;p&gt;Dầu dừa sẽ giúp điều trị bệnh nhiễm trùng đường tiểu hoặc giảm đau ở bệnh sỏi thận&lt;/p&gt;\r\n&lt;p&gt;45. Dưỡng da&lt;/p&gt;\r\n&lt;p&gt;Dầu dừa là một nguyên liệu tự nhiên tự nhiên chống khô da, nứt nẻ. Các bà mẹ cũng có thể dùng dầu dừa xoa lên núm vú để tránh đau khi cho các bé bú.&lt;/p&gt;\r\n&lt;p&gt;46. Bệnh mất trí nhớ Alzheimer&lt;/p&gt;\r\n&lt;p&gt;Trong một vài nghiên cứu gần đây cho thấy dầu dừa sẽ làm chậm phát triển hoặc ngăn ngừa bệnh bệnh mất trí nhớ.&lt;/p&gt;\r\n&lt;p&gt;47. Chắc xương&lt;/p&gt;\r\n&lt;p&gt;Canxi và magie là hai khoáng chất quan trọng bảo vệ và giúp xương chắc khỏe. Dầu dừa hỗ trợ cơ thể bạn hấp thụ hai khoáng chất đó.&lt;/p&gt;\r\n&lt;p&gt;48. Bệnh động kinh&lt;/p&gt;\r\n&lt;p&gt;Dầu dừa sẽ làm giảm tỷ lệ mắc bệnh động kinh . Và cũng làm giảm cường độ của các cơn co giật.&lt;/p&gt;\r\n&lt;p&gt;49. Vóc dáng thon gọn&lt;/p&gt;\r\n&lt;p&gt;Dầu dừa làm tăng sự trao đổi chất trong cơ thể bạn, cải thiện chức năng của tuyến giáp và hỗ trợ giảm cân một cách an toàn.&lt;/p&gt;\r\n&lt;p&gt;50. Nấu ăn&lt;/p&gt;\r\n&lt;p&gt;Khi đun nóng, dầu dừa vẫn đảm bảo an toàn, không hề độc hại như hầu hết các loại dầu ăn khác và mỡ động vật. Dầu dừa sẽ đem đến cho bạn bữa ăn ngon miệng và đảm bảo chất chất dinh dưỡng.&lt;/p&gt;\r\n&lt;p&gt;Minh Trang (&lt;em&gt;theo Sunwarrior&lt;/em&gt;)&lt;/p&gt;</string></var><var name=\'aCategories\'><array length=\'0\'></array></var></struct></data></wddxPacket>','50 CÔNG DỤNG TUYỆT VỜI CỦA DẦU DỪA',NULL,'127.0.0.1','farcry_CLIENTUD'),('<wddxPacket version=\'1.0\'><header/><data><struct><var name=\'TMPCATEGORIES\'><string></string></var><var name=\'FRIENDLYURLS\'><recordset rowCount=\'1\' fieldNames=\'datetimelastupdated,lockedBy,fuStatus,lastupdatedby,applicationName,createdby,refobjectid,friendlyURL,datetimecreated,locked,bDefault,ObjectID,redirectionType,redirectTo,label,ownedby,queryString