nternet từ Facebook.  Bạn có thể tìm hiểu kỹ hơn để yên tâm hơn về những sản phẩm cũng như dịch vụ bán hàng trực tuyến của chúng tôi theo những đường dẫn sau đây:</p>\n<p>                + Facebook: <a href=\"https://www.facebook.com/donghoteenhot\">https://www.facebook.com/donghoteenhot</a></p>\n<p>                + Website: <a href=\"http://duthu.vn/\">duthu.vn</a></p>\n<p>      Bạn hoàn toàn có thể yên tâm đặt hàng rồi nhé!</p>\n<p>Trân trọng!</p>'),(NULL,'2016-01-28 14:54:31',NULL,'farcry_CLIENTUD','farcry_CLIENTUD','2011-12-15 22:18:57',NULL,0,'approved','abcd','duthu.vn',NULL,'displayPageHome','trang chu chuyen test','E689D66F-96FD-E9F6-B1AF64B8DAE78A69','Home',NULL,'Home',NULL,'CDD3B33E-A463-9B75-DC0150D316830765',NULL);
